import React from 'react';
import axios from 'axios';
import App from './test'
import { Button } from '@material-ui/core';
function test(props){
    console.log(props)
axios.get('http://localhost:8080/React_Manage2/myaction.action',
     {
      params: {
        AdminNumber:document.getElementById("ad").value,
        AdminPassword:document.getElementById("pd").value
      }
    })
    .then(function (response) {
      alert(response.data.success)
      if(response.data.success){
        window.location.href = "http://localhost:3000/PersonCenter"
      }
      else
      alert("message error")
    })
    .catch(function (error) {
      console.log(error);
    })
}
export default function pes(){
    return(
        
        <Button onClick={test}></Button>
    )
}
